import React, { Component } from 'react';
import { Text,StyleSheet, TouchableOpacity, ToastAndroid, Platform, AlertIOS, View , Container} from 'react-native';
import { Header, Left, Body, Right, Button, Icon, Title, Item, Input } from 'native-base';

export default class HeaderJS extends Component {

    searchPage(){
        if(Platform.OS === 'android'){
            ToastAndroid.show("Search Page Navigation", ToastAndroid.SHORT)
        }
        else if(Platform.OS === 'ios'){
            AlertIOS.alert('Search Page Navigation');
        }
        else if(Platform.OS === 'web'){
            alert('Search Page Navigation');
        }
    }

  render() {
    return (
        <Header style={{ backgroundColor: 'transparent', elevation: 0.6 }}>
          <Left>
            <Button transparent>
              <Icon type='Entypo' name='medium-with-circle' style={{ color: '#3e2465' }} />
            </Button>
          </Left>
          <Body>
            <Title style={{ color: 'black' }}>DocApp</Title>
          </Body>
          <Right>
            <Button transparent>
                <MaterialIcons name="add-circle-outline" color={color} size={20} />
            </Button>
          </Right>
        </Header>
    );
  }
}
